  <div class="mt-4 flex flex-col gap-4 text-primary-black text-[16px]">
            <p>
              ApaCare - system do pielęgnacji zębów płynnym szkliwem
              zapewniający naturalnie gładkie, zdrowe i lśniące zęby
              Remineralizacja „płynnym szkliwem” zapewniająca ochronę Twoich
              zębów.
            </p>
            <p>
              Podstawowym celem nowoczesnej stomatologii jest utrzymanie jak
              największej ilości zdrowych zębów tak długo, jak to jest tylko
              możliwe. Dla większości społeczeństwa symbolem piękna i zdrowych
              zębów są białe, lśniące zęby. Biel zębom zapewnia szkliwo. Jest
              ono atakowane każdego dnia przez bakterie, kwaśne pożywienie i
              płyny. Również płyny, będące depozytem barwników (np. herbata czy
              kawa) wpływają negatywnie na estetykę zębów. Zarówno szkliwo jak i
              zębina są wobec tych czynników bezbronne. Szkliwo zębowe u
              dorosłych jest wysoce zmineralizowaną bezkomórkową tkanką,
              zawierającą 99% substancji mineralnych. Dlatego szkliwo samo w
              sobie nie ma zdolności regeneracji, czyli odbudowy. Większość
              dotychczas stosowanych materiałów używanych do ochrony szkliwa
              (np. fluorki) działają głównie przez ograniczanie procesu
              rozpuszczania apatytu (głównego budulca szkliwa), a nie przez
              mineralizację prowadzącą do krystalizacji apatytu lub odnowy
              utraconych związków mineralnych. Zębina natomiast może być
              odbudowana samoczynnie, ale nowa tkanka narasta jedynie w kierunku
              miazgi. Powstałe uszkodzenia można naprawić jedynie po
              zastosowaniu materiałów alloplastycznych lub materiałów naturalnie
              występujących w ślinie. Jedną z substancji, która odbudowuje w
              warunkach fizjologicznych szkliwo jest zmikronizowany
              hydroksyapatyt, zwany „płynnym szkliwem”. Wszystkie produkty
              ApaCare zawiera medyczny hydroksyapatyt, który tworzy ochronną
              warstwę na szkliwie, z której dzięki zmikronizowanej strukturze
              hydroksyapatytu wbudowuje się on w szkliwo zęba. Dzięki temu
              szkliwo i zęby stają się bardziej gładkie i jaśniejsze odzyskując
              naturalny kolor. Proces ten nazywany jest remineralizacją szkliwa.
              Medyczny hydroksyapatyt jest nietoksyczny, nie powoduje odpowiedzi
              zapalnej czy immunologicznej, co wynika z faktu, że w
              przeciwieństwie do fluoru, jest niczym „nowym” dla zębów, gdyż
              działa jako biomimetyczny zamiennik utraconych cząstek szkiwa.
            </p>

            <p>
              Dodatkowo, medyczny hydroksypaptyt może być stosowane w celu
              szybkiego i trwałego zamykania otwartych kanalików (porów)
              nadwrażliwych szyjek zębowych. Medyczny hydroksyapatyt zmniejsza
              nadwrażliwość zębów (np. na zimne i ciepłe posiłki).
            </p>

            <h5 class="font-semibold">Produkty systemu ApaCare</h5>
            <div>
              <ul class="list-disc ml-[32px]">
                <li>
                  Tworzą warstwy ochronnej: płynne szkliwo tworzy niewidzialną
                  warstwę ochronną, która pokrywa zęby niczym „druga skóra”.
                </li>
                <li>
                  Zwiększają gładkość i blask zębę: płynne szkliwo zapewnia
                  lśniące gładkie powierzchnie zębów, które nie tylko są
                  przyjemnie gładkie w dotyku, ale także zapewniają promiennie
                  zdrowy uśmiech.
                </li>
                <li>
                  Naprawiają: małe ubytki, wczesne zmiany próchnicowe, pęknięcia
                  i szorstkie miejsca są skutecznie naprawiane przez płynny
                  hydroksyapatyt.
                </li>
                <li>
                  Wybielają: efekty odbicia optycznego zapewniają naturalne
                  wybielenie zębów.
                </li>
                <li>
                  Działają ochronnie na nadwrażliwe szyjki zębów: płynne szkliwo
                  chroni wrażliwe szyjki zębów i zauważalnie zmniejsza reakcje
                  na gorące, zimne lub słodkie pokarmy.
                </li>
              </ul>
            </div>
            <p class="font-semibold">
              dzięki zawartości płynnego szkliwa, czyli medycznego
              hydroksyapatytu!
            </p>
            <p>
              Produkty systemu ApaCare są dostępne w dobrych aptekach,
              specjalistycznych sklepach stomatologicznych, w niektórych
              gabinetach stomatologicznych oraz w Firmie KodeNt.
            </p>
          </div>
